 importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein.'),(6305,583,'el','2023-09-06 11:22:23.103220','2023-09-06 11:22:23.103220','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Delimiter sollten entweder Semikolon oder Tab sein.'),(6306,584,'el','2023-09-06 11:22:23.108341','2023-09-06 11:22:23.108341','Komprimiere deine Protokoll- oder Biografietextdateien in eine zip-Datei und lade sie hoch (die Textdateien mssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen mssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ fr Biographieen \'bg\' und fr Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),(6307,585,'el','2023-09-06 11:22:23.121272','2024-07-29 17:27:21.332784','Transcripts can be uploaded in the formats .csv, .ods, .odt, .vtt, .srt. In .csv and .ods format, the columns must be titled \'In|Timecode\', \'Speaker|Speaker\' and \'Trans[c|k]ript|Translation|Translation\'. Files in .odt format should only contain the transcript text (including speaker markups) without headers, footers or other text.'),(6308,586,'el','2023-09-06 11:22:23.125885','2023-09-06 11:22:23.125885','Nutzeransicht'),(6309,587,'el','2023-09-06 11:22:23.130490','2023-09-07 17:00:27.487278','Editing interface'),(6310,588,'el','2023-09-06 11:22:23.135681','2023-09-06 11:22:23.135681',''),(6311,589,'el','2023-09-06 11:22:23.140850','2023-09-06 11:22:23.140850','       .  '),(6312,590,'el','2023-09-06 11:22:23.146063','2023-09-06 11:22:23.146063','        .  '),(6313,591,'el','2023-09-06 11:22:23.151226','2024-10-02 14:13:35.675500','           Oral.History-Digital.  '),(6314,592,'el','2023-09-06 11:22:23.164787','20